INSERT INTO `kegiatan_lab_foto` VALUES
(1,1,'01JKXKZBNAJKTG9CAZGSXVSA03.jpg','Plotting Praktikum adalah kegiatan rutin yang dilaksanakan sebelum memulai kegiatan praktikum pada awal semester baru. Tujuan utama dari kegiatan ini adalah untuk menentukan pembagian Asisten Praktikum (Asprak) pada setiap kelas praktikum yang akan berjalan selama semester tersebut. Kegiatan ini biasanya melibatkan koordinator praktikum, dosen pengampu, serta calon asisten praktikum yang telah mendaftar dan lolos seleksi.\n\nDalam proses plotting, beberapa tahapan dilakukan, seperti:\nPemetaan Jadwal Praktikum: Menentukan jadwal praktikum sesuai dengan jadwal kuliah dan ketersediaan laboratorium.\nPenyusunan Kelas Praktikum: Membagi mahasiswa ke dalam kelas-kelas praktikum berdasarkan kapasitas laboratorium dan jumlah peserta.\nPemilihan dan Penugasan Asprak: Menyesuaikan jumlah asisten dengan kebutuhan setiap kelas praktikum, memastikan kompetensi asisten sesuai dengan materi yang akan diajarkan.\nPlotting ini sangat penting untuk memastikan proses praktikum berjalan lancar, efisien, dan terorganisir dengan baik selama satu semester penuh.','2025-04-15 20:02:03','2025-04-15 21:42:14'),
(2,2,'01JKXM0SJFD7Q9MBTH13GP7PN7.jpg','Oprec WargaLab (Open Recruitment WargaLab) 2024 adalah kegiatan tahunan yang diselenggarakan oleh komunitas WargaLab untuk merekrut anggota baru yang ingin bergabung dan menjadi bagian dari WargaLab. Kegiatan ini bertujuan untuk memberikan kesempatan kepada mahasiswa yang berminat untuk mengembangkan kemampuan teknis, organisasi, dan kolaborasi melalui keanggotaan di WargaLab.\n\nKegiatan ini dilakukan bekerja sama dengan WargaLab Sistem Informasi (SI), sehingga calon anggota memiliki kesempatan untuk belajar dan berkolaborasi lintas bidang ilmu. Selama proses oprec, calon anggota akan melalui beberapa tahapan, seperti:\nPendaftaran: Peserta yang berminat mendaftar melalui formulir yang telah disediakan.\nSeleksi: Tahap seleksi dilakukan untuk menilai minat, kemampuan, dan motivasi calon anggota.\nOrientasi: Peserta yang lolos seleksi akan mengikuti orientasi untuk memahami visi, misi, dan nilai-nilai WargaLab.\nPenerimaan: Pengumuman anggota baru yang resmi bergabung dalam WargaLab.\nPanitia pelaksana kegiatan ini terdiri dari anggota WargaLab yang berada satu tingkat di atas calon anggota baru. Mereka bertugas merancang dan menjalankan seluruh rangkaian kegiatan oprec, termasuk menyusun materi seleksi, menyelenggarakan pelatihan, serta membimbing peserta selama proses berlangsung.','2025-04-15 20:02:03','2025-04-15 21:42:15'),
(3,3,'01JKXM1ZA2CT90Y2YK4Y1KRA99.jpg','Kegiatan Kekeluargaan Antar Anggota WargaLab adalah acara yang bertujuan untuk mempererat hubungan kekeluargaan dan silaturahmi antar anggota WargaLab. Kegiatan ini berupa acara santai dengan suasana kebersamaan, salah satunya adalah acara bakar-bakar bersama.\n\nAcara ini biasanya melibatkan seluruh anggota WargaLab, baik yang baru maupun yang lama, untuk menciptakan momen kebersamaan di luar rutinitas kegiatan akademik atau organisasi. Dalam kegiatan ini, anggota memiliki kesempatan untuk lebih mengenal satu sama lain, memperkuat kerja sama, serta menciptakan lingkungan yang nyaman dan akrab di dalam komunitas.\n\nRangkaian acara dapat meliputi:\nPersiapan: Pembagian tugas untuk menyiapkan bahan makanan, peralatan, dan tempat acara.\nKegiatan Utama: Bakar-bakar bersama, yang bisa berupa memanggang makanan seperti ayam, ikan, sate, atau jagung, disertai dengan diskusi santai atau permainan kelompok untuk menambah keseruan.\nPenutupan: Refleksi singkat atau ucapan terima kasih dari panitia kepada semua peserta.\nKegiatan ini dirancang untuk meningkatkan rasa kebersamaan dan menciptakan kenangan berharga di antara anggota WargaLab, sehingga suasana kerja sama dalam komunitas dapat berjalan lebih solid dan harmonis.','2025-04-15 20:02:03','2025-04-15 21:42:16'),
(4,4,'01JKXM2WPJP1F9D5ZXZZR0WZRT.jpg','Workshop Bersama IAIN Pamekasan adalah kegiatan kolaboratif yang diselenggarakan oleh WargaLab bersama dengan Institut Agama Islam Negeri (IAIN) Pamekasan. Kegiatan ini bertujuan untuk berbagi pengetahuan, pengalaman, dan keterampilan dalam bidang tertentu yang relevan dengan kebutuhan peserta workshop.\n\nWorkshop ini dirancang untuk memberikan wawasan praktis dan teoritis kepada peserta dengan melibatkan pemateri atau narasumber yang kompeten di bidangnya. Kegiatan ini biasanya mencakup:\nPembukaan: Sambutan dari pihak penyelenggara, baik dari WargaLab maupun IAIN Pamekasan.\nSesi Utama: Penyampaian materi oleh narasumber, yang dapat berupa presentasi, diskusi, atau studi kasus sesuai dengan topik workshop.\nPraktik atau Simulasi: Peserta diajak untuk menerapkan ilmu yang disampaikan melalui kegiatan langsung seperti simulasi atau diskusi kelompok.\nPenutupan: Refleksi, tanya jawab, serta pemberian sertifikat kepada peserta dan narasumber.\nWorkshop ini tidak hanya bertujuan untuk meningkatkan kapasitas peserta, tetapi juga untuk mempererat hubungan antara komunitas WargaLab dan IAIN Pamekasan, menciptakan kolaborasi yang berkelanjutan dalam bidang akademik dan pengembangan keterampilan.','2025-04-15 20:02:03','2025-04-15 21:42:17'),
(5,5,'01JKXM3QTM3ZMGST15W68HRHGT.jpg','Workshop WargaLab TIF WEB dan ML adalah kegiatan rutin yang diselenggarakan oleh WargaLab untuk anggota maupun peserta lainnya yang ingin memperdalam pengetahuan dan keterampilan di bidang pengembangan web (WEB) dan machine learning (ML). Kegiatan ini dirancang untuk mendukung pengembangan kompetensi teknis mahasiswa Teknik Informatika (TIF) dan memberikan pemahaman praktis yang dapat diaplikasikan langsung dalam proyek atau penelitian.\n\nRangkaian kegiatan workshop ini biasanya meliputi:\nPembukaan: Sambutan oleh ketua WargaLab atau panitia penyelenggara untuk menjelaskan tujuan dan manfaat workshop.\nPenyampaian Materi: Narasumber atau pemateri menyampaikan konsep dan teori dasar terkait pengembangan web (seperti HTML, CSS, JavaScript, atau framework modern) serta machine learning (seperti algoritma, model, dan implementasi menggunakan tools seperti Python dan library ML).\nSesi Praktik: Peserta diajak untuk menerapkan langsung materi yang disampaikan, seperti membangun aplikasi web sederhana atau membuat model ML untuk kasus tertentu.\nDiskusi dan Tanya Jawab: Peserta dapat berdiskusi dan bertanya langsung kepada narasumber untuk memperdalam pemahaman.\nPenutupan: Evaluasi kegiatan, pembagian sertifikat, dan foto bersama sebagai dokumentasi.\nWorkshop ini tidak hanya meningkatkan kemampuan teknis peserta, tetapi juga memperkuat budaya belajar bersama di WargaLab, menciptakan lingkungan yang mendukung inovasi dan kolaborasi di bidang teknologi.','2025-04-15 20:02:03','2025-04-15 21:42:18'),
(6,6,'01JKXM4Y0EZXPYHPHZPH8RYC5E.jpg','Magang WargaLab adalah salah satu kegiatan yang menjadi bagian dari rangkaian acara Booting & Memory 2024, sebuah program orientasi mahasiswa baru Teknik Informatika angkatan 2024. Kegiatan ini diselenggarakan oleh WargaLab bekerja sama dengan Himpunan Mahasiswa Teknik Informatika (HIMATIF) untuk mengenalkan lingkungan laboratorium kepada mahasiswa baru sekaligus memberikan pengalaman awal dalam dunia akademik dan praktikum di Teknik Informatika.\n\nRangkaian magang ini berlangsung di tiga laboratorium utama, yaitu:\nLaboratorium CC (Computational and Cyber): Fokus pada pengenalan teknologi komputasi dan keamanan siber.\nLaboratorium TIA (Teknologi Informasi dan Aplikasi): Berorientasi pada aplikasi teknologi informasi dan pengembangan perangkat lunak.\nLaboratorium TMJ (Teknologi Multimedia dan Jaringan): Mengedepankan pengenalan multimedia dan jaringan komputer.\nRangkaian kegiatan meliputi:\nPengenalan Laboratorium: Mahasiswa baru diajak untuk memahami fungsi, fasilitas, dan kegiatan utama di setiap laboratorium.\nSimulasi Praktikum: Peserta diberi kesempatan untuk mengikuti simulasi praktikum dengan bimbingan asisten laboratorium dan WargaLab.\nDiskusi dan Tanya Jawab: Sesi interaktif untuk memperkenalkan peran WargaLab dan memberi wawasan mengenai peluang yang dapat dikembangkan di masing-masing laboratorium.\nKegiatan Kekompakan: Aktivitas yang bertujuan untuk membangun kerja sama antar mahasiswa baru.\nMagang WargaLab sebagai bagian dari Booting & Memory 2024 diharapkan dapat memberikan pengalaman berharga, memupuk semangat kolaborasi, serta membantu mahasiswa baru beradaptasi dengan lingkungan akademik di Teknik Informatika.','2025-04-15 20:02:03','2025-04-15 21:42:21'),
(7,7,'01JKXM5YBHRVRAHTBYEXX7HY1J.jpg','Internship Palacky adalah kegiatan kolaboratif yang melibatkan anggota WargaLab dan mahasiswa asing dari Ceko. Program ini bertujuan untuk memperkenalkan budaya Indonesia sekaligus membangun hubungan internasional yang erat melalui aktivitas yang sederhana, interaktif, dan menyenangkan.\n\nDalam kegiatan ini, anggota WargaLab berperan aktif sebagai tuan rumah yang memperkenalkan keunikan budaya Indonesia kepada mahasiswa Ceko. Hal ini dilakukan melalui berbagai permainan tradisional, diskusi budaya, dan aktivitas kolaboratif lainnya.\nRangkaian kegiatan meliputi:\nPenyambutan: Sesi awal yang mencakup perkenalan antar peserta, pengenalan program, dan pembukaan dengan sapaan khas budaya Indonesia.\nPermainan Tradisional: Anggota WargaLab mengajak mahasiswa Ceko untuk memainkan permainan tradisional Indonesia, seperti engklek, balap karung, atau gobak sodor. Permainan ini dikemas secara modern untuk meningkatkan interaksi dan keseruan.\nDiskusi Budaya: Sesi berbagi cerita antara anggota WargaLab dan mahasiswa Ceko tentang kebudayaan masing-masing negara, termasuk seni, makanan, bahasa, dan tradisi unik.\nPenutupan: Acara diakhiri dengan pemberian cinderamata khas Indonesia kepada mahasiswa Ceko sebagai kenang-kenangan, serta foto bersama untuk dokumentasi.\nProgram ini tidak hanya memperkenalkan budaya Indonesia, tetapi juga memberikan pengalaman lintas budaya yang berharga bagi kedua belah pihak, membangun pemahaman global, dan mempererat hubungan internasional dalam suasana kekeluargaan.','2025-04-15 20:02:03','2025-04-15 21:42:22'),
(8,8,'01JKXM74F92D9S6EKS2093WMFS.jpg','Pemeliharaan dan Bersih-bersih Lab adalah kegiatan rutin yang dilakukan oleh anggota WargaLab sebelum dimulainya kegiatan praktikum pada setiap semester. Kegiatan ini bertujuan untuk memastikan semua laboratorium dalam kondisi optimal dan siap digunakan untuk mendukung proses praktikum, penelitian, dan kegiatan akademik lainnya.\n\nRuang lingkup kegiatan:\nPembersihan Area Laboratorium:\nKegiatan bersih-bersih dilakukan oleh homebase masing-masing lab di lima laboratorium, yaitu:\nLab TIA (Teknologi Informasi dan Aplikasi)\nLab CC (Computational and Cyber)\nLab TMJ (Teknologi Multimedia dan Jaringan)\nLab Riset\nLab Sister (Sistem Informasi dan Terapan)\nAktivitas meliputi menyapu, mengepel, merapikan meja dan peralatan, membersihkan komputer dan perangkat keras, serta mengatur ulang tata letak jika diperlukan.\nPengecekan Fasilitas Laboratorium:\n\nJaringan: Pemeriksaan koneksi internet dan jaringan lokal untuk memastikan semua perangkat terkoneksi dengan baik.\nHardware: Inspeksi perangkat keras seperti komputer, monitor, proyektor, dan perangkat pendukung lainnya untuk memastikan kelayakan pakai.\nSoftware: Memastikan sistem operasi dan perangkat lunak pendukung praktikum terinstal dan berfungsi dengan baik.\nPendataan Peralatan dan Inventaris:\nMelakukan pendataan barang-barang baru yang masuk ke laboratorium.\nIdentifikasi barang-barang yang tidak layak pakai atau memerlukan perbaikan agar dapat diajukan untuk penggantian atau perbaikan.\nTujuan Kegiatan:\n\nMenyediakan lingkungan laboratorium yang bersih, nyaman, dan kondusif untuk belajar.\nMemastikan semua fasilitas laboratorium berfungsi dengan baik untuk mendukung kegiatan praktikum dan penelitian.\nMeningkatkan rasa tanggung jawab anggota WargaLab terhadap fasilitas yang ada.\nDengan adanya kegiatan ini, diharapkan laboratorium tetap terjaga kualitasnya dan dapat mendukung kegiatan akademik dengan maksimal.','2025-04-15 20:02:03','2025-04-15 21:42:28'),
(9,9,'01JKXM8D5FA9AE3TRFT1A56VYK.jpg','Pengadaan Barang Baru adalah kegiatan yang dilakukan oleh Program Studi (Prodi) Teknik Informatika untuk memperbarui dan meningkatkan kualitas fasilitas yang ada di laboratorium-laboratorium di lingkungan Prodi. Kegiatan ini dilakukan pada tahun 2024 dengan tujuan untuk memastikan semua laboratorium memiliki peralatan yang lebih modern dan nyaman digunakan oleh mahasiswa dan dosen selama kegiatan praktikum atau penelitian.\n\nRincian Kegiatan Pengadaan:\nPengadaan PC Baru:\nLaboratorium TIA (Teknologi Informasi dan Aplikasi) dan Lab CC (Computational and Cyber) menerima pengadaan komputer (PC) baru.\nPengadaan ini bertujuan untuk meningkatkan kinerja dan kapasitas sistem komputer di kedua laboratorium tersebut, sehingga mendukung aktivitas praktikum, pemrograman, dan penelitian yang lebih efisien.\nPemasangan Karpet Baru dan Cat Ulang:\nSemua laboratorium Informatika, termasuk Lab TIA, Lab CC, dan lainnya, menerima karpet baru yang lebih nyaman dan aman digunakan.\nSelain itu, setiap laboratorium juga di cat ulang untuk memberikan tampilan yang lebih segar dan bersih, menciptakan suasana yang lebih menyenangkan dan kondusif untuk belajar.\nPengadaan AC:\nPengadaan pendingin udara (AC) baru dilakukan di seluruh laboratorium Informatika untuk menciptakan lingkungan yang lebih nyaman.\nPengadaan ini diharapkan dapat mengurangi suhu panas yang sering terjadi di ruang laboratorium, terutama selama kegiatan praktikum atau penelitian yang memerlukan konsentrasi tinggi.\nTujuan Kegiatan:\nMeningkatkan kenyamanan dan kualitas fasilitas di setiap laboratorium agar mendukung kegiatan akademik yang lebih produktif.\nMemperbarui peralatan laboratorium agar lebih sesuai dengan kebutuhan praktikum, penelitian, dan pengembangan teknologi terbaru.\nMenyediakan lingkungan yang lebih nyaman bagi mahasiswa dan dosen untuk mendalami ilmu di bidang Teknologi Informasi dan Informatika.\nDengan pengadaan barang baru ini, diharapkan laboratorium di Prodi Teknik Informatika akan lebih optimal dalam mendukung kegiatan belajar mengajar serta penelitian di bidang teknologi.','2025-04-15 20:02:03','2025-04-15 21:42:29'),
(10,10,'01JKXM90FAX69KG8HCJMTGCMC0.jpg','Persiapan Sebelum Praktikum adalah kegiatan yang dilakukan untuk memastikan semua peralatan dan lingkungan laboratorium siap digunakan sebelum dimulai praktikum jaringan komputer (jarkom). Kegiatan ini dilakukan oleh anggota WargaLab, dengan peran utama dipegang oleh asisten praktikum jarkom, yang bertanggung jawab atas persiapan teknis dan administratif.\n\nRincian Persiapan yang Dilakukan:\nPengecekan Peralatan Laboratorium:\nAsisten praktikum melakukan pengecekan terhadap perangkat keras (hardware) yang akan digunakan selama praktikum, seperti komputer, switch, router, dan perangkat jaringan lainnya.\nPastikan semua perangkat tersebut berfungsi dengan baik dan siap digunakan.\nPengaturan Jaringan:\nPengecekan konfigurasi jaringan di laboratorium, termasuk memastikan koneksi internet dan jaringan lokal berjalan lancar.\nPengaturan IP address, subnetting, dan pengujian koneksi antar perangkat dilakukan agar peserta praktikum dapat belajar dan bekerja dengan lancar.\nInstalasi Software yang Diperlukan:\nMemastikan perangkat lunak yang dibutuhkan untuk praktikum jarkom, seperti simulator jaringan atau software analisis jaringan, telah terinstal dan dapat digunakan tanpa masalah.\nPersiapan Bahan Ajar dan Modul Praktikum:\nMenyiapkan bahan ajar, modul praktikum, dan instruksi yang akan diberikan kepada peserta. Ini termasuk pengaturan topik-topik yang akan dipelajari selama praktikum, serta persiapan soal atau tugas yang harus dikerjakan oleh peserta.\nPengecekan Sistem Keamanan:\nAsisten juga memeriksa sistem keamanan jaringan dan perangkat untuk memastikan tidak ada masalah yang dapat mengganggu jalannya praktikum, seperti serangan dari luar atau konfigurasi yang salah.\nPersiapan Fasilitas Pendukung:\nMemastikan ruangan praktikum dalam kondisi bersih, nyaman, dan siap digunakan. Ini termasuk pengecekan proyektor, papan tulis, dan fasilitas lainnya yang mendukung jalannya praktikum.\nTujuan Kegiatan:\nMemastikan semua peralatan dan sistem yang digunakan selama praktikum jaringan komputer berfungsi dengan baik.\nMenyediakan lingkungan yang mendukung bagi peserta praktikum untuk memahami konsep-konsep jaringan komputer dengan lancar.\nMeningkatkan efisiensi pelaksanaan praktikum dengan meminimalkan gangguan teknis atau peralatan yang tidak berfungsi.\nDengan persiapan yang matang, praktikum jaringan komputer dapat berjalan lebih efektif, dan mahasiswa dapat mendapatkan pengalaman praktis yang maksimal di bidang teknologi jaringan.','2025-04-15 20:02:03','2025-04-15 21:42:30'),
(11,11,'01JKXM9WX3KDG16ZMXK22X9XNJ.jpg','Praktikum adalah kegiatan praktis yang dilakukan oleh mahasiswa di laboratorium untuk mempelajari dan mengaplikasikan konsep-konsep yang telah diajarkan di dalam kelas. Kegiatan ini dilaksanakan di tiga laboratorium utama, yaitu Lab TIA (Teknologi Informasi dan Aplikasi), Lab CC (Computational and Cyber), dan Lab TMJ (Teknologi Multimedia dan Jaringan).\n\nJenis Praktikum yang Dilakukan:\nPraktikum Alpro (Algoritma dan Pemrograman):\nPraktikum ini fokus pada penerapan algoritma dasar dan teknik pemrograman menggunakan berbagai bahasa pemrograman. Mahasiswa akan belajar membuat dan menguji program sesuai dengan algoritma yang telah dipelajari di mata kuliah.\n\nPraktikum PTI (Pemrograman Teknik Informatika):\nPada praktikum PTI, mahasiswa akan bekerja dengan perangkat lunak dan teknik pemrograman tingkat lanjut yang digunakan di dunia industri. Fokus praktikum ini adalah pengembangan perangkat lunak dan pemrograman sistem.\n\nPraktikum Struktur Data:\nPraktikum ini bertujuan untuk membantu mahasiswa memahami struktur data yang digunakan dalam pemrograman, seperti array, linked list, stack, queue, dan pohon. Mahasiswa akan mengimplementasikan struktur data untuk menyelesaikan berbagai permasalahan komputasi.\n\nPraktikum DPW (Dasar Pemrograman Web):\nPraktikum DPW mengajarkan mahasiswa untuk membangun aplikasi berbasis web menggunakan teknologi web modern. Mahasiswa akan mempelajari cara membuat halaman web interaktif, pengolahan form, dan penghubungan dengan database.\n\nPraktikum Jarkom (Jaringan Komputer):\nPraktikum ini berfokus pada pengenalan dan penerapan konsep-konsep dasar jaringan komputer. Mahasiswa akan mempraktikkan cara mengonfigurasi dan mengelola perangkat jaringan, termasuk router, switch, dan pemecahan masalah jaringan.\n\nPraktikum PAW (Pemrograman Aplikasi Web):\nPada praktikum PAW, mahasiswa belajar tentang pengembangan aplikasi web yang lebih kompleks, yang mencakup pengelolaan data, server backend, serta interaksi antara frontend dan backend aplikasi.\n\nTujuan Kegiatan:\nMemberikan pengalaman praktis kepada mahasiswa dengan menerapkan teori yang telah dipelajari dalam materi kuliah.\nMengembangkan keterampilan teknis mahasiswa di bidang pemrograman, jaringan komputer, pengembangan aplikasi, dan teknologi informasi.\nMembantu mahasiswa dalam mengasah kemampuan problem-solving melalui proyek-proyek praktikum yang beragam.\nKegiatan praktikum ini memberikan kesempatan bagi mahasiswa untuk lebih memahami dan menguasai materi yang diajarkan dengan melakukan eksperimen langsung di laboratorium, mempersiapkan mereka untuk menghadapi tantangan di dunia profesional.','2025-04-15 20:02:03','2025-04-15 21:42:31');
INSERT INTO `laboratorium` VALUES
(1,'Teknologi, Informasi dan Aplikasi','Laboratorium Teknologi Informasi dan Aplikasi atau yang sering disebut dengan Lab TIA merupakan laboratorium milik program studi Teknik Informatika Universitas Trunojoyo Madura yang mana terletak pada lantai 3 Gedung Eksak. Laboratorium ini digunakan untuk menunjang fasilitas, sarana dan prasarana kegiatan belajar dan mengajar bagi mahasiswa dan dosen.','praktikum','teknologi-informasi-dan-aplikasi','2025-04-15 20:02:03','2025-04-15 20:02:03'),
(2,'Common Computing','Laboratorium Common Computing atau biasa disingkat dengan Lab CC merupakan laboratorium milik Program Studi Teknik Informatika Fakultas Teknik Universitas Trunojoyo Madura. Dengan ketua laboratorium Bapak Yoga Dwitya Pramudita, S.Kom., M.Sc. Lab ini terletak pada Gedung Lab Eksak pada lantai 3 berada di samping Laboratorium Teknologi Informasi dan Aplikasi.','praktikum','common-computing','2025-04-15 20:02:03','2025-04-15 20:02:03'),
(3,'Multimedia','Laboratorium Multimedia Computing merupakan suatu wadah di mana mahasiswa dapat merasakan pengalaman mendalam dalam dunia multimedia dan teknologi komputasi. Di sini, mahasiswa diundang untuk menjelajahi beragam konsep dan aplikasi dalam bidang ini, memperluas batas kreativitas mereka melalui berbagai proyek yang menarik. Dari pengembangan perangkat lunak hingga desain grafis dan produksi konten digital, lab ini menjadi tempat di mana gagasan-gagasan segar diterjemahkan menjadi karya nyata. Dengan atmosfer yang mendukung eksperimen dan eksplorasi, mahasiswa didorong untuk mengeksplorasi potensi mereka tanpa batas, sehingga menghasilkan inovasi-inovasi yang inspiratif dan berdampak.','praktikum','multimedia','2025-04-15 20:02:03','2025-04-15 20:02:03'),
(4,'Sistem Terdistribusi dan Jaringan','Laboratorium Sistem Terdistribusi dan Jaringan (Lab SISTER) merupakan pusat penelitian dan praktikum yang fokus pada arsitektur terdistribusi, komputasi awan, serta protokol dan keamanan jaringan komputer. Mahasiswa dapat mengimplementasikan layanan terdistribusi, mempelajari manajemen sumber daya terdistribusi, serta menguji kinerja dan ketahanan jaringan menggunakan perangkat keras dan perangkat lunak terkini.','bidang minat','sistem-terdistribusi-dan-jaringan','2025-04-15 20:02:03','2025-04-15 20:02:03'),
(5,'Komputasi Bahasa Alami','Laboratorium Komputasi Bahasa Alami (Lab KBA) adalah ruang eksperimen dan penelitian untuk pengolahan bahasa manusia menggunakan teknik kecerdasan buatan dan pembelajaran mesin. Di sini, mahasiswa dapat mengeksplorasi analisis sentimen, ekstraksi informasi, penerjemahan mesin, serta pengembangan chatbots dan sistem dialog cerdas melalui proyek-proyek praktikum yang aplikatif.','bidang minat','komputasi-bahasa-alami','2025-04-15 20:02:03','2025-04-15 20:02:03'),
(6,'Kecerdasan Komputasi','Laboratorium Kecerdasan Komputasi (Lab KK) menyediakan fasilitas untuk merancang dan menguji algoritma kecerdasan buatan, mulai dari pembelajaran mesin klasik hingga pembelajaran mendalam. Mahasiswa didorong untuk menerapkan teori-teori optimasi, pengenalan pola, dan pengambilan keputusan otomatis pada berbagai studi kasus, termasuk visi komputer, data mining, dan robotika.','bidang minat','kecerdasan-komputasi','2025-04-15 20:02:03','2025-04-15 20:02:03'),
(7,'Teknologi Perangkat Lunak','Laboratorium Teknologi Perangkat Lunak (Lab TPL) mendukung kegiatan praktikum dan penelitian di bidang rekayasa perangkat lunak. Mahasiswa dapat mempelajari siklus hidup perangkat lunak, metodologi agile, manajemen proyek, serta teknik pengujian dan integrasi berkelanjutan. Lab ini juga dilengkapi alat bantu modern untuk pemodelan, version control, dan deployment.','bidang minat','teknologi-perangkat-lunak','2025-04-15 20:02:03','2025-04-15 20:02:03');
